        "ja": {
          "title": "【完全版】WBC 栗山英樹監督&大谷翔平選手会見 メンバー発表で侍ジャパン本格始動！（2023/1/6）ANN/テレ朝",
          "description": "3月に行われるWBC（ワールド・ベースボール・クラシック）について、\n栗山英樹監督と大谷翔平選手の記者会見が行われました。\n\n日本代表の栗山英樹監督は6日、東京都内のホテルで3月のカーネクスト　2023 ワールド ベースボール クラシック (WBC)東京プールに出場する一部12選手を発表しました。 \nメジャーリーグから大谷翔平（エンゼルス）、ダルビッシュ有投手（パドレス）、鈴木誠也外野手（カブス）が選出されました。\n\n会見には大谷翔平選手が登場。\n「勝ちだけ目指して、勝つことだけ考えていきたいなと思っている。前回出られなかったですし、自身としても初のＷＢＣなので、楽しみにしながら頑張りたいと思っています」と意気込みました。\n\n　国内からは村上宗隆内野手（ヤクルト）、佐々木朗希投手（ロッテ）、山本由伸投手（オリックス）、戸郷翔征投手（巨人）、今永昇太投手と牧秀悟内野手（以上DeNA）、源田壮亮内野手（西武）、甲斐拓也捕手と近藤健介外野手（ソフトバンク）が選ばれました。\n\n▼発表されたメンバーは下記のとおりです。（背番号順）\n背番号：2\n源田壮亮（埼玉西武ライオンズ）\n\n背番号：3\n牧秀悟（横浜DeNAベイスターズ）\n\n背番号：8\n近藤健介（福岡ソフトバンクホークス）\n\n背番号：10\n甲斐拓也（福岡ソフトバンクホークス）\n\n背番号：11\nダルビッシュ有（サンディエゴ・パドレス）\n\n背番号：12\n戸郷翔征（読売ジャイアンツ）\n\n背番号：14\n佐々木朗希（千葉ロッテマリーンズ）\n\n背番号：16\n大谷翔平（ロサンゼルス・エンゼルス）\n\n背番号：18\n山本由伸（オリックス・バファローズ）\n\n背番号：21\n今永昇太（横浜DeNAベイスターズ）\n\n背番号：51\n鈴木誠也（シカゴ・カブス）\n\n背番号：55\n村上宗隆（東京ヤクルトスワローズ）\n\n#大谷翔平 #WBC #侍ジャパン #ワールドベースボールクラシック #野球 #栗山英樹 \n#カーネクスト2023WorldBaseballClassic東京プール\n\n■JapaNews24 ～日本のニュースを24時間配信 \nhttps://www.youtube.com/watch?v=coYw-eVU0Ks\n\n■テレ朝ニュース公式HP\nテレ朝news　https://news.tv-asahi.co.jp/\n\n■テレ朝SNS公式アカウント\nTwitter　https://twitter.com/tv_asahi_news\nTikTok　https://www.tiktok.com/@tv_asahi_news\nFacebook　https://www.facebook.com/tvasahinews"
